import React, { Component } from "react";
import {HashRouter} from "react-router-dom";

import Footer from './Footer.js';
import Header from './Components/HeaderComponent';
class Main extends Component {
    render() {
      return (
        <HashRouter>
          
          <Header/>
          <Footer/>
        </HashRouter>
      );
    }
  }
export default Main;
